package com.studio.model;import java.util.ArrayList;import java.util.List;import javax.persistence.Table;/** * description: * author:          song * createDate:      2017/10/25 */@Table(name = "studio_Project")public class Project extends BaseModel {    private String projectCode;    private String projectName;    private String nameSpace;    private String comment;    private String connectionID;    private String templateID;    private List<Table> tables = new ArrayList<Table>();    public List<Table> getTables() {        return tables;    }    public void setTables(List<Table> tables) {        this.tables = tables;    }    public String getProjectCode() {        return projectCode;    }    public void setProjectCode(String projectCode) {        this.projectCode = projectCode;    }    public String getProjectName() {        return projectName;    }    public void setProjectName(String projectName) {        this.projectName = projectName;    }    public String getNameSpace() {        return nameSpace;    }    public void setNameSpace(String nameSpace) {        this.nameSpace = nameSpace;    }    public String getComment() {        return comment;    }    public void setComment(String comment) {        this.comment = comment;    }    public String getConnectionID() {        return connectionID;    }    public void setConnectionID(String connectionID) {        this.connectionID = connectionID;    }    public String getTemplateID() {        return templateID;    }    public void setTemplateID(String templateID) {        this.templateID = templateID;    }}